    casadi_copy(d_nlp.lbz, 88, d.lbdz);
    casadi_axpy(88, -1.0, d_nlp.z, d.lbdz);
    casadi_copy(d_nlp.ubz, 88, d.ubdz);
    casadi_axpy(88, -1.0, d_nlp.z, d.ubdz);
